import * as SQLite from 'expo-sqlite';


const openDatabase = () => {
  const db = SQLite.openDatabaseSync('durhamTransit.db');
  createStopsTable(db);
  console.log('Database opened');
  try {
    insertManyStops(db);
    console.log('Stops inserted');
  } catch (error) {
    console.error('Error inserting stops:', error);
  }
  
  return db;
} 

const createStopsTable = async (db) => {
    try {
        await db.execAsync(`CREATE TABLE IF NOT EXISTS stops (
            stop_id INT PRIMARY KEY,
            stop_name VARCHAR(512),
            stop_lat DOUBLE,
            stop_lon DOUBLE
        );`);
        console.log('Stops table created');
    } catch {
        console.error('Error creating stops table');
    }
  };


export const getClosestStopFromDatabase = async (userLat, userLon) => {
    const db = openDatabase(); // Get the database instance
    try {
        const toRadians = (degrees) => (degrees * Math.PI) / 180;
        const earthRadiusKm = 6371;

        const calculateDistance = (lat1, lon1, lat2, lon2) => {
        const dLat = toRadians(lat2 - lat1);
        const dLon = toRadians(lon2 - lon1);
        const a =
            Math.sin(dLat / 2) * Math.sin(dLat / 2) +
            Math.cos(toRadians(lat1)) *
            Math.cos(toRadians(lat2)) *
            Math.sin(dLon / 2) *
            Math.sin(dLon / 2);
        const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
        return earthRadiusKm * c;
        };

        let closestStop = null;
        let minDistance = Infinity;
        const stops = db.getFirstAsync('SELECT * FROM stops');
        console.log('Stops:', stops.stop_id);
        // Iterate through all rows and calculate the distance
        for await (const row of db.getEachAsync('SELECT * FROM stops')) {
            const distance = calculateDistance(userLat, userLon, row.stop_lat, row.stop_lon);
            console.log(`Stop ID: ${row.stop_id}, Distance: ${distance} km`);

        if (distance < minDistance) {
            minDistance = distance;
            closestStop = row;
        }
        }

        if (closestStop) {
            console.log('Closest stop:', closestStop);
        return closestStop; // Return the closest stop
        } else {
            console.warn('No stops found in the database');
        return null;
        }
    } catch (error) {
        console.error('Error fetching closest stop from database:', error);
        return null;
    }
};

